import React from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
// import './Navbar.css'; // Import the CSS file for styling
// import logo from './logo.png'; // Import the logo image

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        {/* <img src={logo} alt="Restaurant Logo" className="navbar-logo" /> */}
        <span className="navbar-title">Halli Mane</span>
      </div>

      <div className="navbar-right">
        <input type="text" placeholder="Search..." className="navbar-search" />
        <button className="navbar-button">Search</button>
      </div>
      <div className="navbar-middle">
        <Link to="/add-food" className="navlinks">Add Food</Link>
        <Link to="/orders" className="navlinks">Orders</Link>
      </div>
    </nav>
  );
};

export default Navbar;
